import React, {Component} from 'react';


class App extends Component{
    render(){
        return(
            <div className='container-fluid bg' style={{display:'flex', flexDirection:'column', justifyContent:'center', padding: 0}}>
               
                <div  className='' style={{backgroundColor:'#C3DDDDCC', height: '32vh', justifySelf:'center'}}>
                </div>

                <div style={{marginTop:'4em'}}>
                    <button className='btn'>Espace volontaire</button>
                    <button className='btn'>Qui sommes nous ?</button>
                    <button className='btn'>Espace association</button>

                </div>
                
            </div>

        )
    }
}

export default App
